import { View, Text, FlatList } from "react-native";
import React from "react";

export default function ProductList() {
  const data = [
    {
      id: 1,
      name: "Manish",
      age: "23",
    },
    {
      id: 2,
      name: "Manish",
      age: "23",
    },
    {
      id: 3,
      name: "Manish",
      age: "23",
    },
    {
      id: 4,
      name: "Manish",
      age: "23",
    },
    {
      id: 5,
      name: "Manish",
      age: "23",
    },
  ];

  const Item = ({ name }) => (
    <View>
      <Text>{name}</Text>
    </View>
  );

  const renderItem = ({ item }) => (
    <Item title={item.name} />
  );

  return (
    <View>
      <FlatList
        data={data}
        renderItem={renderItem}
        keyExtractor={(item) => item.id}
      />
    </View>
  );
}
